import React from 'react'
import { Outlet, Link } from 'react-router-dom'

const Feed = () => {
  return (
    <>
      <div id='feedContainer'>
        <div id='navFeed'>
          <Link to="/" style={{ fontSize: "5vh", textDecoration: "none", color: "#0a66c2", fontWeight: "700",margin }}>Connect <span style={{ backgroundColor: "#0a66c2", color: "white", padding: ".2vh .5vh", borderRadius: "1vh" }}>ing</span></Link>

        </div>

      </div>
    </>
  )
}

export default Feed;
